    body: "{\"input\":[\"# Dauphinois de potimarron - recette v\xE9g\xE9tarienne cuisine-libre.org\\n\\n##
      Description\\n\\nPr\xE9paration\_: 20\_min Cuisson\_: 1\_h [Four](https://www.cuisine-libre.org/four)\\n\\n![V\xE9g\xE9tarien](https://www.cuisine-libre.org/local/cache-vignettes/L40xH40/moton18-9d595.png?1644794211
      \\\"V\xE9g\xE9tarien\\\")\\n\\nSans\_viande Sans\_\u0153uf\\n\\nDauphinois de\_potimarron
      Rated 5.00 out of 5 based on 2 ratings.\\n\\n![](https://www.cuisine-libre.org/local/cache-gd2/6d/60311ebc0c8cb1dfbbe3e5cf92e9fd.jpg?1675005547)\\n\\n![App\xE9tissante
      photo DR](https://www.cuisine-libre.org/local/cache-gd2/c6/f3d3dd24ed5a690a2e6ad481f8a95c.jpg?1675005547)\\n\\n##
      Ingr\xE9dients pour 4\\n\\n- potimarron de 1\_kg (ou\_plus)\\n- cr\xE8me fraiche
      liquide (fleurette)\\n- ail\\n- beurre\\n- sel, poivre\\n\\n## Pr\xE9paration\\n\\nPr\xE9chauffer
      le four \xE0 180/200\xB0C.\",\"Couper le potimarron en \xAB\_taillons\_\xBB
      de quelques millim\xE8tres d\u2019\xE9paisseur.  \\nFrotter d\u2019une gousse
      d\u2019ail \xE9pluch\xE9e un plat \xE0 four en terre. Y\_r\xE9partir les \xAB\_taillons\_\xBB
      en couches, saler et poivrer entre chaque couche. Verser la cr\xE8me, qui doit
      juste couvrir le potimarron (jusqu\u2019\xE0 un litre en fonction de la taille
      du plat). Parsemer de quelques noisettes de beurre, pour le gratin\xE9 final.\\n\\nCuire
      une heure environ, forcer \xE0\_220\xB0C les dix derni\xE8res minutes.\\n\\n##
      <:info_post_scriptum:>\\n\\nUn plat qui se r\xE9chauffe plus facilement que
      le vrai [gratin dauphinois](https://www.cuisine-libre.org/gratin-dauphinois)
      (aux pommes de terre). Cette recette m\u2019a \xE9t\xE9 propos\xE9e par ma productrice
      de l\xE9gumes pr\xE9f\xE9r\xE9e\_: c\u2019est la recette du gratin dauphinois
      appliqu\xE9e \xE0 la courge. Elle\_convient au potimarron et aux vari\xE9t\xE9s
      de citrouilles fermes.\\n\\n- [![](https://www.cuisine-libre.org/local/cache-gd2/13/f50d96b2f12916e2df6b65f1bd381c.jpg?1644794690)Potimarron](https://www.cuisine-libre.org/potimarron)\"],\"model\":\"embeddings-small\",\"encoding_format\":\"float\"}"
