      le potimarron en \xAB\_taillons\_\xBB de quelques millim\xE8tres d\u2019\xE9paisseur.
      \ \\nFrotter d\u2019une gousse d\u2019ail \xE9pluch\xE9e un plat \xE0 four en
      terre. Y\_r\xE9partir les \xAB\_taillons\_\xBB en couches, saler et poivrer
      entre chaque couche. Verser la cr\xE8me, qui doit juste couvrir le potimarron
      (jusqu\u2019\xE0 un litre en fonction de la taille du plat). Parsemer de quelques
      noisettes de beurre, pour le gratin\xE9 final.\\n\\nCuire une heure environ,
      forcer \xE0\_220\xB0C les dix derni\xE8res minutes.\\n\\n## <:info_post_scriptum:>\\n\\nUn
      plat qui se r\xE9chauffe plus facilement que le vrai [gratin dauphinois](https://www.cuisine-libre.org/gratin-dauphinois)
      (aux pommes de terre). Cette recette m\u2019a \xE9t\xE9 propos\xE9e par ma productrice
      de l\xE9gumes pr\xE9f\xE9r\xE9e\_: c\u2019est la recette du gratin dauphinois
